import React, { useState } from 'react';

function ProfilePage() {
  const [profile, setProfile] = useState({ name: '', age: '', schoolYear: '', interest: '' });

  const handleChange = (event) => {
    setProfile({...profile, [event.target.name]: event.target.value});
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Handle profile save logic here
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>
        Name:
        <input type="text" name="name" value={profile.name} onChange={handleChange} />
      </label>
      <label>
        Age:
        <input type="number" name="age" value={profile.age} onChange={handleChange} />
      </label>
      <label>
        School Year:
        <input type="text" name="schoolYear" value={profile.schoolYear} onChange={handleChange} />
      </label>
      <label>
        Interest:
        <select name="interest" value={profile.interest} onChange={handleChange}>
          <option value="OptionA">OptionA</option>
          <option value="OptionB">OptionB</option>
          <option value="OptionC">OptionC</option>
        </select>
      </label>
      <button type="submit">Save</button>
    </form>
  );
}

export default ProfilePage;
